import Link from 'next/Link'

const Home = () => (
  <Link href="/about">
    dupa
  </Link>
);

Home.getInitialProps = async ({ req }) => {
  const userAgent = req ? req.headers['user-agent'] || '' : navigator.userAgent;
  return { userAgent };
};

export default Home;
